import React from 'react';
import './css/style.min.css';

export default function App() {
  return (
    <main>
      <div className="start-quiz">
        <h1>Quizzical</h1>
        <p>Test your knowledge</p>
        <button>Start quiz</button>
      </div>
    </main>
  );
}
